import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form action="" method="POST">
        <input type="text" id="url" name="url" size="80" /><br/ >
        <br /><br />
        <input type="submit" value="Download"></input>
      </form>
    </div>
  );
}

export default App;
